function Header() {
    return (
        <div className="header">
          <div className="header_left">
              <IconButton>
              <MenuIcon />
              </IconButton>
              <img src="https://www.freepnglogos.com/uploads/green-email-logo-png-3.png" alt="green email logo png" />
          </div>
          <div className="header_middle "  >

              </div>  
           <div className="header_right ">
              
              </div> 
        </div>
    )
}

export default Header
